import React from 'react';
import NavbarTop from './NavbarTop';
import badgedisabled from '../img/badgedisabled.svg';
import badgeenabled from '../img/badgeenabled.svg';

import lessonicon from '../img/lessonicon.svg';
import '../App.css';

export default function Dashboard() {
	let badgeImg = [badgedisabled, badgeenabled];
	return (
		<article>
			<header>
				<NavbarTop />
			</header>
			<body>
				<div style={styles.container}>
					{badgeImg.map(imgLink => (
						<LessonElement name={imgLink} />
					))}
				</div>
			</body>
		</article>
	);
}

function LessonElement(props) {
	return (
		<div style={styles.container}>
			<img
				src={lessonicon}
				style={{
					height: '20vmin',
					background: '#dae1e7ff',
					borderRadius: '50%',
					padding: '20px'
				}}
			/>
			{badgeImg.map(imgLink => (
				<LessonElement name={imgLink} />
			))}
			<LessonTitle />
		</div>
	);
}

function LessonTitle(props) {
	return (
		<div style={styles.rowContainer}>
			<img
				src={badgedisabled}
				style={{
					height: '5vmin'
				}}
			/>
			<p
				style={{
					fontWeight: '700',
					color: 'rgb(87, 86, 92)',
					fontFamily: 'din-round, sans-serif'
				}}
			>
				Basics training
			</p>
		</div>
	);
}

const styles = {
	defaultFontFamily: {
		fontFamily: 'din-round, sans-serif'
	},
	lessonElement: {
		height: '15vmin'
	},
	container: {
		minHeight: '50vh',
		display: 'flex',
		flexDirection: 'column',
		alignItems: 'center',
		justifyContent: 'center',
		fontSize: 'calc(10px + 2vmin)'
	},
	rowContainer: {
		height: '100%',
		display: 'flex',
		flexDirection: 'row',
		alignItems: 'top',
		justifyContent: 'center'
	}
};
